INSERT INTO `post` VALUES ('71', '日军为什么从来包围不了八路军', '<h1 style=\"margin: 0px; padding: 8px 0px 0px 15px; font-size: 16px; float: left; white-space: nowrap; text-overflow: ellipsis; width: 600px; color: rgb(56, 53, 44); overflow: hidden;\">日军为什么从来包围不了八路军？</h1><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">在抗日正面战场，假如国民党被优势日军包围，基本上是被包饺子一锅端，在强大的日军面前，仅靠救生本能想跳出鬼子包围圈，那可比登天还难。</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\"><img src=\"/BBS/resource/img/upload/20170905/1504626625702095621.jpg\" title=\"1504626625702095621.jpg\" alt=\"001.jpg\"/></span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">但是八路军长期在日军后方活动，经常被优势日军包围，却基本上没有被日军围歼造成重大损失，八路军到底是长了三头六臂还是能飞檐走壁，这个答案今天来揭晓。</span></span><a target=\"_blank\" href=\"http://pic.tiexue.net/bbs_12704235_1.html\" style=\"color: rgb(56, 53, 44); text-decoration-line: none; outline: none;\"><img src=\"/ueditor/jsp/upload/image/20170905/1504626472399060963.jpg\" alt=\"日军为什么从来包围不了八路军？\" title=\"日军为什么从来包围不了八路军？（图2）\"/></a></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">其实，不论是行军打仗还是经济发展，要想做好都离不开一句话，那就是“预则立不预则废”，八路军之所以能在日军后方游刃有余，主要成就就在“预”上。</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">要想突出日军重围，必须要有备无患，正如129师师长刘伯承所说：“各级组织要把备战放在首位，经常假象各种敌情，预先看好地形，以便于应战……!”</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><a target=\"_blank\" href=\"http://pic.tiexue.net/bbs_12704235_1.html\" style=\"color: rgb(56, 53, 44); text-decoration-line: none; outline: none;\"><img src=\"/ueditor/jsp/upload/image/20170905/1504626473116090536.jpg\" alt=\"日军为什么从来包围不了八路军？\" title=\"日军为什么从来包围不了八路军？（图3）\"/></a></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">1942年5月日军在华北发动“五一大扫荡”，八路军总部明令：“各部如到村庄必须把每个院落打通，把进庄路口封死，村里村外筑三道工事为基础”。这样的战备意识，即使鬼子到眼前也占不了便宜。</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">1943年太岳军区周希汉部太过疲劳，准备就地宿营两小时，但周希汉要求不能解背包，东西山头要不简单放哨，果然，日军寻迹包抄，八路军很快就占领制高点遏制日军攻势，坚持到夜间突围而去。</span></span></p><p><img src=\"/BBS/resource/img/upload/20170905/1504626650073095584.jpg\" title=\"1504626650073095584.jpg\" alt=\"002.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><br/></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><a target=\"_blank\" href=\"http://pic.tiexue.net/bbs_12704235_1.html\" style=\"color: rgb(56, 53, 44); text-decoration-line: none; outline: none;\"><img src=\"/ueditor/jsp/upload/image/20170905/1504626473379084638.jpg\" alt=\"日军为什么从来包围不了八路军？\" title=\"日军为什么从来包围不了八路军？（图4）\"/></a></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">在遇到围困之时，尤其考验一支部队的战斗力和凝聚力，国民党则在这种情况下吃大亏，特别是南京保卫战最后撤退阶段，可谓兵不知将将更不知兵，最后损失惨重，造成了极大的无畏伤亡。而八路军在被日军包围的情况下，仍然令行禁止，配合无间，组织性之严密是突围的保证。</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">陆房战斗就是八路军突围的典型案例，当时的八路军115师686团被日军8000多人围困在陆房，陆房村位于山地丘陵盆地中央，四面环山，被日军围困后形势非常危急。</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><a target=\"_blank\" href=\"http://pic.tiexue.net/bbs_12704235_1.html\" style=\"color: rgb(56, 53, 44); text-decoration-line: none; outline: none;\"><img src=\"/ueditor/jsp/upload/image/20170905/1504626473650016195.jpg\" alt=\"日军为什么从来包围不了八路军？\" title=\"日军为什么从来包围不了八路军？（图5）\"/></a></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">当时的115师代师长陈光果断命令从日军最薄弱处突围，并向部队传达了最严格的突围纪律，不准发声，不准咳嗽，一路上日军骑兵从潜行的八路军身旁奔驰而过，日军哨兵喊话清晰入耳，但是日军硬是没有发现八路军动静，几千人奇迹般从日军鼻子底下脱险。</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">八路军突围所表现的突出的军事素养是在长期军事训练情况下得来的，平时指挥员就对各式各样的敌情进行预演，找到应对措施，到了真正危急关头就不会慌乱和无以为对了。</span></span></p><p><img src=\"/BBS/resource/img/upload/20170905/1504626675111041924.jpg\" title=\"1504626675111041924.jpg\" alt=\"003.jpg\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><br/></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><a target=\"_blank\" href=\"http://pic.tiexue.net/bbs_12704235_1.html\" style=\"color: rgb(56, 53, 44); text-decoration-line: none; outline: none;\"><img src=\"/ueditor/jsp/upload/image/20170905/1504626473994056874.jpg\" alt=\"日军为什么从来包围不了八路军？\" title=\"日军为什么从来包围不了八路军？（图6）\"/></a></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"color:#606060\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">凡事“预则立不预则废”！还真是政治军事经济发展一条普遍的真理！</span></span></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><a target=\"_blank\" href=\"http://pic.tiexue.net/bbs_12704235_1.html\" style=\"color: rgb(56, 53, 44); text-decoration-line: none; outline: none;\"><img src=\"/ueditor/jsp/upload/image/20170905/1504626474585019623.jpg\" alt=\"日军为什么从来包围不了八路军？\" title=\"日军为什么从来包围不了八路军？（图7）\"/></a></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><a target=\"_blank\" href=\"http://pic.tiexue.net/bbs_12704235_1.html\" style=\"color: rgb(158, 0, 0); outline: none;\"><img src=\"/ueditor/jsp/upload/image/20170905/1504626474791083011.jpg\" alt=\"日军为什么从来包围不了八路军？\" title=\"日军为什么从来包围不了八路军？（图8）\"/></a></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><img src=\"/BBS/resource/img/upload/20170905/1504626701990036273.jpg\" title=\"1504626701990036273.jpg\" alt=\"004.jpg\"/></p><p class=\"bbsp\" style=\"margin-top: 10px; margin-bottom: 0px; padding: 0px; border: 0px; font-size: 16px; line-height: 25px; font-family: &quot;Microsoft YaHei&quot;; text-indent: 2em;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-size: 12px;\"><span style=\"color:#c0c0c0\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\">战在墙外说历史</span></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: &quot;&quot;;\"><span style=\"color:#c0c0c0\">&nbsp;</span><span style=\"color:#add8e6\">08-29 08:43</span></span></span></p><p><br/></p>', 'null', '666', '2017-09-05 23:53:03', '00000000161', '255', '天天军事', '0000000001');
INSERT INTO `post` VALUES ('72', '求助 如何劝说爸妈不执着于彩礼', '<p><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">基本情况是我是家中独女 二三线城市人 收入税前14k 无经济负担</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　准备与男友结婚&nbsp;</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　男友收入略高于我 家中无负担</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　近几年家中也有姐妹结婚 彩礼确实比较高 但是各家有各家的情况&nbsp;</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　父母同学也有女儿出嫁 各个情况不一</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　我自己是想说男方父母的心意 给多少都行 也不缺 也不在意</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　但是父母认为给的少就是不重视 看不起我 觉得我不值钱&nbsp;</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　可能也是父母钻了牛角尖 现在我劝说父母会被认为还没结婚胳膊就向外拐</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　请问该如何劝说父母&nbsp;</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　谢谢大家</span></p><p><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\"><img src=\"/BBS/resource/img/upload/20170906/1504659817782014392.jpg\" title=\"1504659817782014392.jpg\" alt=\"161401723044359627818.jpg\"/></span></p>', 'null', '1010', '2017-09-06 09:03:43', '00000000007', '0', '七彩生活', '0000000000');
INSERT INTO `post` VALUES ('73', '为何三四线城市能涨价去库存？', '<p><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">大家都有个常识，那就是某商品过剩后只能降价去库存，为何三四线城市的过剩商品房能涨价去库存？</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　商品房这玩艺，实质是银行花钱建银行花钱买，中国的银行是国有的是公家的。当然商品房交易对象形式上是地产商(大部分建房资金来自银行)与购房者(大部分买房资金来自银行)，实质为银行左手倒右手，这正是没有工作机会鬼城一大片的三四线城市能以涨价去库存的原因。</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　关键是15年搞去库存前三四线城市就有一大堆房子卖，就已经是个巨大的泡沫，如今以涨价去库存把泡沫吹得更大，这恐怕只有中国特色的银行国有\\中国特色的土地财政\\中国特色的非市场方式操控才能做到。13年就抛房的李嘉城在四年后仍被打脸，无语。</span><br/><span style=\"font-family: 宋体; text-align: justify; background-color: rgb(238, 238, 238);\">　　局面走到这一步，或许地产银行两个行业的体制回到九八年以前可破解。</span><img src=\"/BBS/resource/img/upload/20170906/1504660055189035244.jpg\" title=\"1504660055189035244.jpg\" alt=\"timg (1).jpg\"/></p>', 'null', '1012', '2017-09-06 09:07:41', '00000000002', '0', '科技财经', '0000000000');
INSERT INTO `post` VALUES ('74', '王者荣耀：再不改改，估计嗨氏要被赶出斗鱼了', '<p><img src=\"https://p1.pstatp.com/large/37f300038749f60f19b2\" alt=\"王者荣耀：再不改改，估计嗨氏要被赶出斗鱼了\"/></p><p><span style=\"color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);\">王者荣耀知名主播嗨氏估量最近心里十分糟糕，本来是虎牙力捧的王者荣耀一哥人物，先是侵权画手事件，表面上通知观众现已宽和并且下架相关商品，然而实际上还在持续售卖，被两位画手选用法律武器告上了法庭，随即与某斗鱼高管达成协议，自导自演了一出成心找楚河撕逼，营造出一种被水友逼走的假象加盟斗鱼，可是没想到打好的算盘也呈现了纰漏，被挖出了各种黑料，其间嗨氏自己更是被爆出是前不久黑张大仙的幕后主使，尽管最后如愿以偿的来到了斗鱼，可是如同并不怎样受欢迎。</span></p><p><img src=\"https://p1.pstatp.com/large/39a000037f4fa2d41634\" alt=\"王者荣耀：再不改改，估计嗨氏要被赶出斗鱼了\"/></p><p><span style=\"color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);\">嗨氏在斗鱼直播王者荣耀的弹幕，不知道最初挖嗨氏过来的那位高管，你上个月的奖金还有没有的拿了？嗨氏来到斗鱼照旧没有低沉的意思，近来又有网友爆出嗨氏与斗鱼职工谈天爆出。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);\"><img src=\"https://p9.pstatp.com/large/37ed000389654985c74c\" alt=\"王者荣耀：再不改改，估计嗨氏要被赶出斗鱼了\"/></span></p><p><span style=\"color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);\">又在为自己要人气分配，其实各大渠道主播的人气多多少少都会有一些水分，否则也不会闹出13亿观看人数的笑话出来。</span></span></p>', 'null', '1012', '2017-09-06 09:12:20', '00000000006', '0', '游戏快讯', '0000000000');
INSERT INTO `post` VALUES ('75', '美为何没有击落朝导弹？美国专家实话实话，“它不能”', '<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; background-color: rgb(255, 255, 255);\">约书亚·波拉克(Joshua Pollack)是《防止核扩散评论》的编辑，也是位于加州蒙特利的米德尔伯里国际研究所(Middlebury Institute of International Studies)的高级研究员。周二，他在英国《卫报》刊文时称，为什么美国没有击落朝鲜的导弹，一种可能性是，没有任何一种宙斯盾舰能够拦截这种导弹。除非有一场真正的战争，我们不知道他们会有多有效；导弹防御系统只会在一场极具破坏性的战争开始时，为美国军方及其盟友争取一些时间。译文如下：</span></p><p><img src=\"/BBS/resource/img/upload/20170906/1504660488098053065.jpg\" title=\"1504660488098053065.jpg\" alt=\"39a400033c3d2e592b3c.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">也许国防方面的任何方面,都不像弹道导弹防御系统那样被人们所理解。上周，朝鲜用一枚中程弹道导弹对日本进行了攻击，许多人都想知道为什么它没有被击落。答案可能是令人失望的——但希望它们也会有启发性。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">在平壤周日宣称已经测试了一枚可以装载在洲际弹道导弹上的氢弹后，对导弹防御能力的关注只会增加。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">要理解的第一个也是最根本的问题是，发展和运行弹道导弹防御系统是一项极具挑战性的任务。有些比其他的要好，但是由此产生的系统，在其功能和角色上天生就受到限制。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">也许最具吸引力的防御体系现在根本就不存在，而且很可能永远也不会存在。美国曾考虑过全球范围内的“启动阶段”拦截器，它将在近地轨道环绕地球旋转，但这一想法的复杂性和经济意义令人生畏。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">最近，美国制造了一种“空中激光”原型机——一种制造在波音747上的大型武器，旨在通过燃烧一个洞，在飞行早期摧毁来袭导弹。该计划因成本、技术缺陷和缺乏操作现实主义而被取消:飞机将不得不在靠近敌人领土的危险地带徘徊，以便在导弹上有任何机会，这使得它在发射前极容易受到攻击。对手也可以避开沿海地区的发射。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">由美国国家科学学院组织的Apanel研究了其他的选择，主要是在中期阶段，因为导弹或携带弹头的“再入飞行器”，都是要经过太空的。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">随后的报告对美国国土安全部现有的中程防御系统非常不满，该系统被称为陆基中程防御系统(GMD)，它主要位于阿拉斯加，目的是阻止对北美和夏威夷的攻击。学院委员会提倡用一个全新的、升级的系统取代GMD。取而代之的是，国会继续将资源投入到GMD的增量改进中。GMD的飞行测试成本为数亿美元，并且只工作了大约一半的时间。</p><p><img src=\"/BBS/resource/img/upload/20170906/1504660552591006197.jpg\" title=\"1504660552591006197.jpg\" alt=\"1111cbad7.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">为什么GMD是这样的一个案例?部分原因在于这一概念的非凡雄心，还有部分原因在于开发和部署的草率。上世纪90年代末，一个专家小组警告称，美国的BMD项目中存在一种缺陷的模式，这是由意识到实现“早期能力”的紧迫性所驱动的。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">这些发现似乎确实影响了许多美国的BMD项目，在过去的20年中，这些项目在更系统和令人满意的情况下进行了。但是，作为美国防御系统的拓展系统，GMD却没有。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">五角大楼自己的内部权威测试和评估已经猛烈抨击了GMD的不可靠性、对付潜在攻击的脆弱性，以及雷达网络的不足。去年，由美国科学家联盟提起的一份报告，描绘了一项在国会的监督下的项目，极大的代价结果令人失望 。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">世界上现有的BMD系统的大部分都属于第三类:终端防御。美国的爱国者和“宙斯盾”系统，以及俄罗斯和中国的导弹系统，以及以色列的箭系统，“萨德”，都涉及拦截导弹，这些导弹的目标是，当攻击弹道通过大气层向目标飞行时，捕捉攻击导弹，(THAAD有能力在大气层上方拦截。)这类防御系统的测试记录越来越令人印象深刻。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">“爱国者”、“萨德”和“ 宙斯盾”是针对朝鲜在该地区的导弹袭击所采取的防御措施。但由于它们是终端防御，它们保护相对较小的区域，靠近它们自己的位置。爱国者通常被归类为“点防御”，并用于保护军事基地。“萨德”是一种“区域防御”，其覆盖范围更广；美国部署了一个萨德系统，以覆盖其太平洋岛屿关岛，另一个用来保护韩国的南半部。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">“宙斯盾”主要是基于海基的系统，因其高度的不同而不同。“爱国者”和“萨德”可以在需要的时候，通过公路或飞机进行移动，但装备有宙斯盾的船只随时在该地区航行。韩国的“宙斯盾”号舰艇配备了sm-2终端拦截器;他们的日本和美国的同类也携带了sm-3中拦截导弹，这构成“区域防御” 。</p><p><img src=\"/BBS/resource/img/upload/20170906/1504660596586093651.jpg\" title=\"1504660596586093651.jpg\" alt=\"222228690e68.jpg\"/></p>', 'null', '1012', '2017-09-06 09:16:38', '00000000003', '0', '天天军事', '0000000000');
INSERT INTO `post` VALUES ('76', '拉肚子吃什么好？8种食物有效缓解腹泻，天然的养胃高手！', '<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">炎热的夏天，大家都会食用大量的冷饮来满足自己，但是在你得到降温的同时，你的肠胃也会接受不了的，这个时候就容易引起腹泻了。那么怎样才能有效地调理胃肠功能、预防胃肠疾病呢？</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">以下8种调理肠胃的食物，是天然肠胃保养高手，一起来看一下吧。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">1、红薯</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">红薯富含蛋白质、淀粉、果胶、纤维素、氨基酸、维生素及多种矿物质，有“长寿食品”之誉。含糖量达到15%-20%。有抗癌、保护心脏、预防肺气肿、糖尿病、减肥等功效。</p><p><br/><img src=\"/BBS/resource/img/upload/20170906/1504660791754099515.jpg\" title=\"1504660791754099515.jpg\" alt=\"33333333333f8a5d.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">2、南瓜</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">南瓜细软易吸收。南瓜有很好的养胃功效，它富含的碳水化合物、果胶可以保护胃部免受刺激，其含有的膳食纤维非常细软，易吸收。</p><p><img src=\"/BBS/resource/img/upload/20170906/1504660837689096078.jpg\" title=\"1504660837689096078.jpg\" alt=\"4444444f6c07a97.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">3、圆白菜</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">圆白菜被誉为天然“胃菜”，生津止渴助消化，能够促进胃液分泌，保护胃黏膜。</p><p><img src=\"/BBS/resource/img/upload/20170906/1504660870024016589.jpg\" title=\"1504660870024016589.jpg\" alt=\"555550acb78876a.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">4、海带</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">海带是一种营养价值很高的蔬菜，同时具有一定的药用价值。含有丰富的碘等矿物质元素。</p><p><img src=\"/BBS/resource/img/upload/20170906/1504660904924085623.jpg\" title=\"1504660904924085623.jpg\" alt=\"666684ed882b04.jpg\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">5、黑木耳</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">黑木耳为木耳科植物，其性平味甘，人胃、大肠经。具有滋补、润燥、养血益胃、活血止血、润肺、润肠的作用。</p><p><img src=\"/BBS/resource/img/upload/20170906/1504660941434011482.jpg\" title=\"1504660941434011482.jpg\" alt=\"77777777779354e1e46.jpg\"/></p>', 'null', '1012', '2017-09-06 09:22:23', '00000000006', '0', '七彩生活', '0000000000');
