INSERT INTO `post` VALUES ('78', '快讯!美国一架F-16“战隼”战斗机坠毁', '<p style=\"margin: 23px auto 0px; padding: 0px; list-style: none; font-size: 14px; line-height: 26px; font-family: SimSun; text-indent: 2em; color: rgb(43, 43, 43); white-space: normal; overflow: visible !important;\">【环球网快讯&nbsp;记者 赵衍龙】美国亚利桑那州传F-16战机坠毁意外。</p><p style=\"margin: 23px auto 0px; padding: 0px; list-style: none; font-size: 14px; line-height: 26px; font-family: SimSun; text-indent: 2em; color: rgb(43, 43, 43); white-space: normal; overflow: visible !important;\">美国《国会山》报9月5日援引美国广播公司消息称,美国国民警卫队(National Guard)称一架属于亚利桑那州空军警卫队F-16“战隼”战斗机,当地时间周二下午在萨福德(Safford)西北方20里附近失事坠毁</p><p><img src=\"/BBS/resource/img/upload/20170906/1504669220534016856.jpg\" title=\"1504669220534016856.jpg\" alt=\"1111cbad7.jpg\"/></p><p>去问驱蚊器围墙围起围墙围起我asda</p>', 'null', '1015', '2017-09-06 11:40:33', '00000000002', '0', '天天军事', '0000000000');
